import React from 'react';
import { withRouter } from 'react-router-dom';
import {
    IonMenu,
    IonHeader,
    IonToolbar,
    IonTitle,
    IonContent,
    IonItem,
    IonMenuToggle
} from '@ionic/react';

const Menu: React.FC = () => {
    return (
        <IonMenu contentId="main" menuId="main-menu">
            <IonHeader>
                <IonToolbar color="primary">
                    <IonTitle>Start Menu</IonTitle>
                </IonToolbar>
            </IonHeader>
            <IonContent>
                <IonMenuToggle>
                    <IonItem>Home</IonItem>
                </IonMenuToggle>
                <IonMenuToggle>
                    <IonItem>About</IonItem>
                </IonMenuToggle>
            </IonContent>
        </IonMenu>
    );
}

export default withRouter(Menu);
